import React from 'react';
import ItemListDetail from '../item-list-detail';
import connect from 'react-redux';
const ItemList = ({items}) => {
    return(
        <ul>
            {
                items.map(i=>(
                    <li>
                        <ItemListDetail item={i}/>
                    </li>
                ))
            }
        </ul>
    )
  
}

const forRedux = ({items}) => {items}

export default connect()(ItemList);
